import React from 'react'

function Creditos(){
    return(
        <section className="credito">
            <div className="container-credit">
                <div>
                    <h5>Te quedaste sin puntos</h5>
                    <h5>Ahora podés sumar cargando tu nombre de usuario y contraseña</h5>
                    <h5>Recuerda que sólo podrás cargar los valores que están prestablecidos</h5>
                </div>
                <div className="form-container">
                    <form action="">
                        <input type="text"/>
                        <input type="text"/>
                    </form>
                </div>

            </div>
        </section>
    );
}

export default Creditos;
